import dotenv from "dotenv";
dotenv.config();

import React from "react";
import { createRoot } from "react-dom/client";
import App from "./components/App/App";
import "./index.css";

const root = createRoot(document.getElementById("root"));
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);
